import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';



//console.log(<App />)
ReactDOM.render(
  <App />,
  document.getElementById('root')
);
ReactDOM.render(<div>hello</div>)

//document.querySelector('#root')._reactRootContainer

